import styled from "styled-components";

export const HeaderWrapper = styled.div`
    height: 56px;
    border-bottom: 1px solid #f0f0f0;   
`

export const Logo = styled.a`
    display: inline-block;
    width: 100px;
    height: 56
    background-color: orange;

`
